sls.lookupPlaceCode = function(place){
	var tempArray = place.split(", ");
	if(tempArray.length == 3 && tempArray[2] == "United States"){
		console.log("this is a u.s. city");
		var lookup = tempArray[0]+tempArray[1];
		if(sls.uslocations.indexOf(lookup) > -1){
			return sls.uscodes[sls.uslocations.indexOf(lookup)];
		} else {
			console.log("unknown us city: "+place);
			return 0;
		}
	} else if (tempArray.length == 2 && tempArray[1] == "United States"){
		console.log("this is a u.s. state");
		if(sls.censuslocations.indexOf(tempArray[0]) > -1){
			return sls.censuscodes[sls.censuslocations.indexOf(tempArray[0])];
		} else {
			console.log("unknown us state: "+place);
			return 0;
		}
	} else if(tempArray.length == 1){
		console.log("one word, outside the us");
		if(sls.censuslocations.indexOf(tempArray[0]) > -1){
			return sls.censuscodes[sls.censuslocations.indexOf(tempArray[0])];
		} else {
			console.log("unknown us state: "+place);
			return 0;
		}
	} else if(tempArray.length == 2){
		if(sls.censuslocations.indexOf(place) > -1){
			return sls.censuscodes[sls.censuslocations.indexOf(place)];
		} else if(sls.worldlocations.indexOf(place) > -1){
			return sls.worldcodes[sls.worldlocations.indexOf(place)];
		} else {
			console.log("unknown 2-word location: "+place);
			return 0;
		}
	} else if(tempArray.length == 3){
		var lookup = tempArray[0]+", "+tempArray[2];
		if(sls.censuslocations.indexOf(lookup) > -1){
			return sls.censuscodes[sls.censuslocations.indexOf(lookup)];
		} else if(sls.worldlocations.indexOf(lookup) > -1){
			return sls.worldcodes[sls.worldlocations.indexOf(lookup)];
		} else {
			console.log("unknown 3-word location: "+place);
			return 0;
		}
	} else {
		console.log("unrecognized: "+place);
		return 0;
	}
}